import React from 'react'
import FoodItem from '../UI/FoodItem';

function Meals() {
    const foodItemList = [
      { id: Math.random().toString(), name: "Pizza", price: 200 },
      { id: Math.random().toString(), name: "Burger", price: 80 },
      { id: Math.random().toString(), name: "Sandwich", price: 50 },
      { id: Math.random().toString(), name: "Fries", price: 50 },
      { id: Math.random().toString(), name: "Puff", price: 30 },
      { id: Math.random().toString(), name: "Pasta", price: 150 },
    ];
  return (
    <div className='meals'>
          {foodItemList.map((item) => 
              <FoodItem name={ item.name} key={item.id} price={item.price}   />
          )}
    </div>
  )
}

export default Meals
